class NgHymnsKuTualaZimpandeZiaCili {
  static List<HymnsContent> list =[
    HymnsContent(id: 3405, position: 1, content: "Tu nevu luhande olu, \nYesu A ohiela,\nAmbululenu kuose, \nYesu A ohiela,\nTualenu muzimbu ou \nNoku kua lenga mavu,\nHamenu mu va leke, \nYesu A ohiela.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3406, position: 2, content: "Tambekenu ku membo, \nYesu A ohiela,\nNa mu vindzango viavo, \nYesu A ohiela:\nMu va leke na ngozi \nNa kavumbi ka Yesu,\nVakuetu vevue vuino, \nYesu A ohiela.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3407, position: 3, content: "Ku ndzita ya Satana, \nYesu A ohiela,\nNdzili yeni ya kama, \nYesu A ohiela:\nSimpenu vakua ku lua, \nNdzita vuovuno i hua,\nTuamekenu pandelo,\nYesu A ohiela.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_47, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3408, position: 4, content: "Amba vose tu imbienu, \nYesu A ohiela,\nMiyati yose A lema, \nYesu A ohiela:\nYesu A li na ngozi, \nUezile ku tu kula,\nKu nkole ya Satana \nNa vuno A ohiela.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_47, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3409, position: 1, content: "Nji zolela mu ku pangela Yesu,\nNji zolela nji zolela;\nNji na uana ku huima ku mutima,\nMu ku pangela Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3410, position: 2, content: "Mu ku pangela Yesu,\nNji linga na zindzili;\nNji zolela na ku vezika,\nMu ku pangela Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_48, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3411, position: 3, content: "Nji zolela mu ku pangela Yesu,\nNji zolela, nji zolela;\nNji na uana Kavusamba ua cili,\nMu ku pangela Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3412, position: 4, content: "Nji zolela mu ku pangela Yesu\nNji zolela, nji zolela;\nNa nji hana muono Ueni ua ya-ye,\nMu ku pangela Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_48, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3413, position: 5, content: "Nji zolela mu ku pangela Yesu,\nNji zolela, nji zolela;\nMu mutima nja vezika cikuma;\nMu ku pangela Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_48, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3414, position: 1, content: "Ngozi na cikeketima,\nKuli Yesu nji uana;\nMutima u viukilila,\nOmo nji Mu yoyela.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_49, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3415, content: "Nji na pande ku tua ceke,\nKuli vakua milima;\nLinga na vakevo vevue,\nKu-viuka ca mutima.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_49, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3416, position: 2, content: "Litangua li na ce laza,\nNa vutsiki vu keza;\nNa umo uahi a hasa,\nKu pangela Muangana.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_49, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3417, position: 3, content: "Yesu Nguendi, Yenu kuose.\nNa ku va ambuluila;\nNja va tsililile vose,\nMuono Nja va nehela.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_49, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3418, position: 4, content: "Tambeka na ndzili yose,\nKu vantu hano hose;\nUze eza kuli Yange,\nKa Nji ka mu sekula.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_49, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3419, position: 1, content: "Leka vantu ha mavu\nNgozi ya Muene Yesu;\nVaze va na zimbala,\nYesu a va tambula.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3420, content: "Vose ambululenu,\nVakua-vivi ha mavu;\nVose va tenguluka,\nYesu A ka tambula.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_50, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3421, position: 2, content: "Iza A ku huimisa,\nTava ku lijui Liendi;\nNga na vuvi u hiana,\nA tambula va-vavi.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3422, position: 3, content: "Mbunge yange i sambua,\nUze Ua nji hingile;\nUa fuetele mulonga,\nVa-vavi A tambula.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_50, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3423, position: 4, content: "A tambula va-vavi,\nNambe yange na vuvi;\nCili A nji tanesa,\nMuilu A ka nji tuala.", hymnsNumber: NgHymnsNumberSeeder.KU_TUALA_ZIMPANDE_ZIA_CILI_50, typeStanza: HymnsContentCode.VERSE),
  ];
